/*Table structure for table `broker` */

DROP TABLE IF EXISTS `broker`;

CREATE TABLE `broker` (
  `ai_broker_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL COMMENT 'user_id is the broker_id',
  `service_area` text,
  `additional_services` text,
  `company_details` text,
  `bio` text,
  `location_id` int(11) DEFAULT NULL COMMENT 'This save the location id (virtually stores lat, long etc)',
  `is_trashed` int(1) DEFAULT NULL,
  `is_deleted` int(1) DEFAULT NULL,
  `creation_time` datetime DEFAULT NULL,
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`ai_broker_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

