/*Table structure for table `cms` */

DROP TABLE IF EXISTS `cms`;

CREATE TABLE `cms` (
  `ai_page_id` int(11) NOT NULL AUTO_INCREMENT,
  `uri` varchar(255) CHARACTER SET latin1 DEFAULT NULL COMMENT 'page identifier to detect the page',
  `page_title` varchar(255) CHARACTER SET latin1 DEFAULT NULL COMMENT 'Page title',
  `meta_keywords` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `meta_description` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `template` varchar(255) CHARACTER SET latin1 DEFAULT NULL COMMENT 'main designing template stored in themes/layout dir',
  `mobile_content` text COMMENT 'display mobile content if device is mobile',
  `content` text CHARACTER SET latin1,
  `published` int(1) DEFAULT NULL,
  `is_deleted` int(1) DEFAULT '0' COMMENT 'is_deleted 1 means row is deleted virtually',
  `creation_time` datetime DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `language_id` int(2) DEFAULT NULL COMMENT 'store language id from language table',
  PRIMARY KEY (`ai_page_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

